import React, { Component } from 'react';
import './App.css';
import Nav from "../client/components/Nav";
import Resume from "../client/components/Resume";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav/>
        <Resume />

      </div>
    );
  }
}

export default App;
